    return(
        
        <div className={styles.card}>
            {
                pokemones.map(({attack, defense, hp, id,img,name, speed}) => {
                    return < Card 
                       id={id}
                       name={name}
                       attack={attack}
                       defense={defense}
                       img={img}
                       hp={hp}
                       speed={speed}
                    //    onClose={onClose}asdsa
                    />
                 } )
