              {pokemones.map(({ id, name }) => (
                <Card
                    id={id}
                    name={name}
                />
            ))

         //* ers un conponent, no fucion , como esta en {Return}
         }  
        <div className={styles.card}>Card 1</div>
      
        
    
                
        
        </div>
    )
}

export default Cards;
